import React from "react";
import "./Resume.css"; // Make sure to import your CSS file
import { FaHtml5, FaJs, FaReact, FaNode, FaCss3 } from "react-icons/fa";

const skillsList = [
  {
    name: "Web Development",
    iconComponent: <FaHtml5 />,
  },
  {
    name: "JavaScript",
    iconComponent: <FaJs />,
  },
  {
    name: "React",
    iconComponent: <FaReact />,
  },
  {
    name: "Node.js",
    iconComponent: <FaNode />,
  },
  {
    name: "HTML/CSS",
    iconComponent: <FaCss3 />,
  },
  // Add more skills here
];

const education = [
  {
    institution: "Flatiron School",
    location: "Fresno, CA",
    degree: "Full Stack Web Development",
    details:
      "Python with Flask and JavaScript program, MySQL, 06/2023 - 10/2023",
  },
  {
    institution: "Codecademy",
    location: "Fresno, CA",
    degree: "Front-end Web Development",
    details:
      "React, Javascript, Angular, Ionic, Node.js, Firebase, MongoDB, 09/2019 - 10/2022",
  },
  {
    institution: "Autonomy University",
    location: "Aguascalientes, MX",
    degree: "Bachelor's Degree in Digital Marketing",
    details: "08/2012 - 05/2015",
  },
];

const projects = [
  {
    title: "MYFLIX",
    link: "https://sandyjime21.github.io/MYFLIX/",
    description:
      "Utilized Axios to fetch data from Movie DB API. Implemented Firebase for user auth data storage. Ensured responsive design for mobile devices.",
  },
  {
    title: "Pianito",
    link: "https://sandyjime21.github.io/Pianito/",
    description:
      "Created an interactive keyboard interface. Implemented Firebase for user auth data storage. Implemented user-friendly design for practice sessions.",
  },
  {
    title: "Candy Shop",
    link: "https://sandyjime21.github.io/Candy-Shop/",
    description: "Designed game mechanics and user interface. Utilized JavaScript for game logic.",
  },
  {
    title: "Franco Cleaning",
    link: "https://sandyjime21.github.io/Franco-Cleaning/",
    description: "Developed website using JavaScript and Bootstrap styling. Designed a user-friendly interface for service offerings.",
  },
  {
    title: "My Sous Chef",
    link: "https://sandyjtech.github.io/my-sous-chef/",
    description:
      "Created a recipe-based website that showcases my expertise in API rendering and data fetching using JavaScript. Collaborated effectively with a team to design and develop a user-friendly platform for food enthusiasts. Implemented robust features for searching and displaying recipes, enhancing user experience and interaction.",
  },
  {
    title: "Badreads",
    link: "https://sandyjtech.github.io/badreads/",
    description:
      "Developed a web application for book enthusiasts, showcasing proficiency in JavaScript and web development. Designed an intuitive and visually appealing user interface that allows users to search and explore a vast collection of books. Implemented features such as book searching, information retrieval, and user reviews, enhancing the overall experience for book lovers. Collaborated with team members to create a seamless user journey and efficient data retrieval from external sources.",
  },
];

const Resume = () => {
  return (
    <div className="resume-container">
      <div className="resume">
        <div className="resume-left">
          <div className="skills">
            <h2>Skills</h2>
            <div className="skills-list">
              {skillsList.map((skill, index) => (
                <div key={index} className="skill">
                  {skill.iconComponent} <span>{skill.name}</span>
                </div>
              ))}
            </div>
          </div>
          <div className="education">
            <h2>Education</h2>
            {education.map((edu, index) => (
              <div key={index} className="edu-item">
                <h3>{edu.institution}</h3>
                <p>{edu.location}</p>
                <p>{edu.degree}</p>
                <p>{edu.details}</p>
              </div>
            ))}
          </div>
        </div>
        <div className="resume-right">
          <div className="resume-heading">
            <h1>Your Name</h1>
            <p>Full Stack Software Engineer</p>
          </div>
          <div className="resume-section">
            <h2>Cover Letter</h2>
            <p>
              I am a Full Stack Software Engineer with a passion for creating
              innovative solutions and bringing ideas to life. I'm ready to take
              on new challenges and contribute to exciting projects.
            </p>
          </div>
          <div className="projects">
            <h2>Technical Projects</h2>
            {projects.map((project, index) => (
              <div key={index} className="project">
                <h3>{project.title}</h3>                
                <p>{project.description}</p>
              </div>
            ))}
          </div>
          {/* Add more sections of your resume here */}
          <div className="resume-divider"></div>
          <div className="resume-download">
            <a href="/path-to-resume.pdf" download>
              Download PDF
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Resume;
